import React from 'react'

export default class Welcome extends React.Component {
    constructor(){
        super();
        this.state = {};
    }

    render(){
        return (
            <div>
                <h1>Welcome</h1>

                <form>
                    <label>
                        First name:
                        <input type='text'  />
                    </label>

                    <label>
                        Last name:
                        <input type='text'  />
                    </label>

                    <label>
                        Email name:
                        <input type='text'  />
                    </label>

                    <label>
                        Difficulty:
                        <select>
                            <option value='easy'>Easy</option>
                            <option value='medium'>Medium</option>
                            <option value='hard'>Hard</option>
                        </select>
                    </label>

                </form>
            </div>
        );
    }
}
